name: DmWSDLCachePolicy
model_only: true
list_item: true
attributes:
- name: Match
  type: String
  description: Provide a literal or wildcard expression to define a URL set included
    in this cache policy.
- name: TTL
  type: Int64
  minimum: 5
  maximum: 86400
  default: 900
  description: Configures lifetime in seconds of document. Enter an integer between
    5 and 86400. The default value is 900.
